import React, { Component } from "react";
import Customer from "./components/Customer";
import { map } from "rsvp";

const customer = [
  {
    id: 1,
    image: "http://placeimg.com/64/64/1",
    name: "홍길동",
    birthday: "961222",
    gender: "남자",
    job: "대학생"
  },
  {
    id: 2,
    image: "http://placeimg.com/64/64/2",
    name: "ksw",
    birthday: "961222",
    gender: "남자",
    job: "대학생"
  },
  {
    id: 3,
    image: "http://placeimg.com/64/64/3",
    name: "ksh",
    birthday: "961222",
    gender: "남자",
    job: "대학생"
  }
];

class App extends Component {
  render() {
    return (
      <div>
        {customer.map(c => {
          return (
            <Customer
              id={c.id}
              image={c.image}
              name={c.name}
              birthday={c.birthday}
              gender={c.gender}
              job={c.job}
            />
          );
        })}
      </div>
    );
  }
}

export default App;
